webpackJsonp([0x5b50cef96e79],{1870:function(a,e){a.exports={data:{markdownRemark:{html:'<p>凌晨读一本小说《媾疫》，以西北为背景故事，是一种现代寓言，故事本身带有很多的荒诞性，但是让人有一种神秘文化的感觉，看完之后觉得是虚构，有一种寓意，可能作者对寓意本身也不明确。把《民主的困惑》的注释和体例统一了，花了不少时间。电脑虽然带来了很多便利，但是由于便利，也就增加了修饰方面的时间，总想求得比较地完美。把第一章导论的题目改为"受困惑的民主"，将结论的题目改为"憧憬中的前景"，以和各章的标题风格一致。</p>',id:"/home/swain/workspace/political-life/src/pages/zh/0115.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/zh/0115.md",frontmatter:{title:"6月21日 星期二"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/zh/0115.md absPath of file >>> MarkdownRemark"}}}});
